import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
ReactDOM.render(
	<div id='suit'>
		<h1>asdas</h1>
		<div id='anotherone'>
			<h2>asd</h2>
		</div>
	</div>,
	document.getElementById('root')
);
class ShoppingList extends React.Component
{
	render(){
		return(
			<div id='suit'>
			<h1>asdas</h1>
			<div id='anotherone'>
				<h2>asd</h2>
		</div>
	</div>);
	}
}
